import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function createData(Device, Status, Arivaltime, Exittime, Action) {
  return { Device, Status, Arivaltime, Exittime, Action };
}

const rows = [
  createData("Sort", 237, 9.0, 37, 4.3),
  createData("Delinternet-office", 262, 16.0, 24, 6.0),
  createData("Delinternet-office", 305, 3.7, 67, 4.3),
];

export default function BasicTable() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table}>
        <TableHead>
          <TableRow>
            <TableCell align="right">Device</TableCell>
            <TableCell align="right">Status</TableCell>
            <TableCell align="right">Arival&nbsp;time</TableCell>
            <TableCell align="right">Exit&nbsp;time</TableCell>
            <TableCell align="right">Action</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.Status}</TableCell>
              <TableCell align="right">{row.Arivaltime}</TableCell>
              <TableCell align="right">{row.Exittime}</TableCell>
              <TableCell align="right">{row.Action}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
